import {
  IonButton,
  IonButtons,
  IonContent,
  IonInput,
  IonItem,
  IonLabel,
  IonPage,
  IonToolbar,
} from "@ionic/react";
import React from "react";

const SignIn: React.FC = () => {
  return (
    <IonPage>
      <IonContent>
        <IonToolbar>
          <IonItem>
            <IonLabel position="floating">Cell Number</IonLabel>
            <IonInput></IonInput>
          </IonItem>
            <IonButton href="/dashboard" type="submit" expand="block"> SignIn</IonButton>       
        </IonToolbar>
      </IonContent>
    </IonPage>
  );
};

export default SignIn;
